import React from 'react';
import Christian from '../../images/team/Christian.jpg';
import Shane from '../../images/team/Shane.jpg'

const Team = () => {
  const style = {
    height: "250px",
    width: "250px",
    boxShadow: "0 10px 20px 0 rgba(10, 10, 10, 0.63)",
    borderRadius: "2%"
  }

  const headerSectionStyle = {
    borderBottom: "1px solid rgba(0,0,0,.125)",
    width: "fit-content",
    margin: "auto",
    padding: "5px",
  }

  return (
    <>
        <div className="card" style={{width: "18rem", color: "black"}}>
      <img src={Shane} className="card-img-top" alt="Shane" />
      <div className="card-body">
        <h5 className="card-title">Card title</h5>
        <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
        <a href="#" className="btn btn-primary">Go somewhere</a>
      </div>
    </div>
    </>
  )
}

export default Team;
